class Solution:
    def smallestSufficientTeam(
        self, req_skills: List[str], people: List[List[str]]
    ) -> List[int]:
        d = {s: i for i, s in enumerate(req_skills)}
        m, n = len(req_skills), len(people)
        p = [0] * n
        for i, ss in enumerate(people):
            for s in ss:
                p[i] |= 1 << d[s]

        # Create a large dictionary to store intermediate results
        mem = {}
        for i in range(len(people)):
            for j in range(len(people)):
                if i == j:
                    continue
                mem[(i, j)] = []

        # Create a large list to store intermediate results
        dp = [-1] * (1 << m)
        dp[0] = 0

        # Iterate over all possible subsets of people
        for i in range(1 << m):
            if dp[i] == -1:
                continue

            # For each person
            for j in range(len(people)):
                # If the person has the required skills
                if self.has_required_skills(people[j], req_skills, d):
                    # Check if the person is already in the team
                    if not self.is_in_team(i, people[j], mem):
                        # Add the person to the team
                        new_state = i | (1 << d[people[j][0]])
                        dp[new_state] = dp[i] + 1
                        # Store the person in the team
                        mem[(i, j)] = people[j]

        # Find the smallest sufficient team
        i = (1 << m) - 1
        ans = []
        while i:
            # Find the person who was added last
            j = self.find_last_added_person(i, dp, mem)
            # Add the person to the team
            ans.append(j)
            # Update the state
            i = i & ~(1 << d[people[j][0]])

        return ans

    def has_required_skills(self, person, req_skills, d):
        for s in req_skills:
            if (1 << d[s]) & person == 0:
                return False
        return True

    def is_in_team(self, i, person, mem):
        for k, v in mem.items():
            if k[1] == person:
                return True
        return False

    def find_last_added_person(self, i, dp, mem):
        for k, v in mem.items():
            if k[0] == i:
                return k[1]
        return -1
